import React from "react";
import { ButtonComponent } from "../buttonComponent/button";

interface FoodContainerProps {
  img?: React.ReactNode;
  onButtonClick: (buttonIndex: number) => void;
}

export const FoodContainer: React.FC<FoodContainerProps> = ({
  img,
  onButtonClick,
}) => {
  const handleButtonClick = (buttonIndex: number) => {
    onButtonClick(buttonIndex);
  };

  return (
    <div>
      {img && <div>{img}</div>}
      <ButtonComponent
        onClick={() => handleButtonClick(1)}
        type={"primary"}
        children={undefined}
        size={1}
        id={""}
      >
        Botão 1
      </ButtonComponent>
      <ButtonComponent
        onClick={() => handleButtonClick(2)}
        type={"primary"}
        children={undefined}
        size={1}
        id={""}
      >
        Botão 2
      </ButtonComponent>
      <ButtonComponent
        onClick={() => handleButtonClick(3)}
        type={"primary"}
        children={undefined}
        size={1}
        id={""}
      >
        Botão 3
      </ButtonComponent>
    </div>
  );
};
